create table person (
	id INT NOT NULL PRIMARY KEY,
	first_name VARCHAR(50) NOT NULL,
	last_name VARCHAR(50) NOT NULL,
	email VARCHAR(50) NOT NULL,
	gender VARCHAR(50) NOT NULL,
	date_of_birth DATE NOT NULL,
	country VARCHAR(50) NOT NULL
);


select distinct country  from person

select * from person limit 10

--get the second elemnt of the list

select * from person offset 0 limit 1

--in keyword
select * from person where country = 'China' or country='Russia'
select * from person where country in ('China','Russia','Greece')

select * from person where country in ('China','Russia','Greece') order by country

--find peron born between 2000  to 2015
select * from person where date_of_birth between DATE '2000-01-01' and '2015-01-01'

--select email starts with blinklist.com

select * from person where email LIKE 'blinklist.com%'
--select email containing  blinklist.
select * from person where email LIKE '%blinklist.%'
--select email ends with .com
select * from person where email LIKE '%.com'

--get the count of persons based on coutry
select count(*),country from person group by country

--get the count of persons greater than 5
select count(*) as people,country from person group by country  having count(id) > 5

